0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">42集全/已完结</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/83651/">倚天屠龙记2001</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%90%B4%E5%90%AF%E5%8D%8E------------/" target="_blank">吴启华</a>&nbsp;<a href="/s/-%E9%BB%8E%E5%A7%BF------------/" target="_blank">黎姿</a>&nbsp;<a href="/s/-%E4%BD%98%E8%AF%97%E6%9B%BC------------/" target="_blank">佘诗曼</a>&nbsp;<a href="/s/-%E5%88%98%E6%9D%BE%E4%BB%81------------/" target="_blank">刘松仁</a>&nbsp;<a href="/s/-%E7%B1%B3%E9%9B%AA------------/" target="_blank">米雪</a>&nbsp;<a href="/s/-%E6%B1%9F%E5%B8%8C%E6%96%87------------/" target="_blank">江希文</a>&nbsp;<a href="/s/-%E9%99%88%E5%B0%91%E9%9C%9E------------/" target="_blank">陈少霞</a>&nbsp;<a href="/s/-%E5%BC%A0%E5%85%86%E8%BE%89------------/" target="_blank">张兆辉</a>&nbsp;<a href="/s/-%E6%BB%95%E4%B8%BD%E5%90%8D------------/" target="_blank">滕丽名</a>&nbsp;<a href="/s/-%E5%88%98%E5%AE%B6%E8%BE%89------------/" target="_blank">刘家辉</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%BA%84%E4%BC%9F%E5%BB%BA--------/" target="_blank">庄伟建</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/14/" target="_blank">港台剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%A6%99%E6%B8%AF-----------/" target="_blank">香港</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2001/" target="_blank">2001</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>改编自金庸的武侠长篇小说《倚天屠龙记》武当派五侠张翠山（刘松仁 饰）与天鹰教教主之女殷素素（米雪 饰）因争夺屠龙刀而相识相爱，两人的结合遭到了江湖中正道人士的反对，为得到张翠山义兄金毛狮王谢逊（骆应钧 饰）和屠龙刀的下落武林各派逼死了张翠山，殷素素也殉情，留下儿子张无 忌托付给武当。长大成人的张无忌</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/83651/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/82987/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-05-09/201905091557381030.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/82987/">拳神2001</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E7%8E%8B%E5%8A%9B%E5%AE%8F------------/" target="_blank">王力宏</a>&nbsp;<a href="/s/-%E6%A2%81%E5%92%8F%E7%90%AA------------/" target="_blank">梁咏琪</a>&nbsp;<a href="/s/-%E5%86%AF%E5%BE%B7%E4%BC%A6------------/" target="_blank">冯德伦</a>&nbsp;<a href="/s/-%E6%9D%A8%E6%81%AD%E5%A6%82------------/" target="_blank">杨恭如</a>&nbsp;<a href="/s/-%E6%B4%AA%E9%87%91%E5%AE%9D------------/" target="_blank">洪金宝</a>&nbsp;<a href="/s/-%E5%BC%A0%E8%80%80%E6%89%AC------------/" target="_blank">张耀扬</a>&nbsp;<a href="/s/-%E5%85%83%E5%BD%AA------------/" target="_blank">元彪</a>&nbsp;<a href="/s/-%E5%8F%B6%E7%AB%A5------------/" target="_blank">叶童</a>&nbsp;<a href="/s/-%E9%83%91%E4%BC%8A%E5%81%A5------------/" target="_blank">郑伊健</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%85%83%E5%A5%8E--------/" target="_blank">元奎</a>&nbsp;<a href="/s/-----%E5%88%98%E4%BC%9F%E5%BC%BA--------/" target="_blank">刘伟强</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/6/" target="_blank">动作片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%A6%99%E6%B8%AF-----------/" target="_blank">香港</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2001/" target="_blank">2001</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>政府研发了一项秘密武器——拳神手套，它能够激活人类大脑中那未被使用的百分之九十部分，从而使使用者爆发超人的能量，十分危险，警察战廿一（张耀扬 饰）成为了手套的首批试用者中的一份子，然而，他的内心不满自己沦为政府操纵的木偶，于是偷走了手套，并且销毁了和手套相关的一切资料&nbsp;　　阿风（元彪 饰）</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/82987/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/82931/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-05-06/201905061557127026.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">6.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/82931/">钟无艳2001</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%83%91%E7%A7%80%E6%96%87------------/" target="_blank">郑秀文</a>&nbsp;<a href="/s/-%E6%A2%85%E8%89%B3%E8%8A%B3------------/" target="_blank">梅艳芳</a>&nbsp;<a href="/s/-%E5%BC%A0%E6%9F%8F%E8%8A%9D------------/" target="_blank">张柏芝</a>&nbsp;<a href="/s/-%E9%BB%84%E6%B5%A9%E7%84%B6------------/" target="_blank">黄浩然</a>&nbsp;<a href="/s/-%E6%9E%97%E9%9B%AA------------/" target="_blank">林雪</a>&nbsp;<a href="/s/-%E7%8E%8B%E5%A4%A9%E6%9E%97------------/" target="_blank">王天林</a>&nbsp;<a href="/s/-%E8%AE%B8%E7%BB%8D%E9%9B%84------------/" target="_blank">许绍雄</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%9C%E7%90%AA%E5%B3%B0--------/" target="_blank">杜琪峰</a>&nbsp;<a href="/s/-----%E9%9F%A6%E5%AE%B6%E8%BE%89--------/" target="_blank">韦家辉</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/7/" target="_blank">喜剧片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%A6%99%E6%B8%AF-----------/" target="_blank">香港</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2001/" target="_blank">2001</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>春秋战国时期，一向昏庸好色的齐宣王（梅艳芳饰）误闯夜叉山，碰上了美丽的寨主钟无艳（郑秀文饰），齐宣王决定把钟无艳娶为皇后，可是一直倾心于钟无艳的“狐狸精”（张柏芝饰）出手阻挠，只要钟无艳爱上其他的人，脸上便会无缘无故多出一块难看的红斑狐狸精后来化身夏迎春勾引齐宣王，齐宣王终日沉醉温柔乡。而钟无艳为了</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/82931/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-x